}P;

P p[maxn];

bool cmp1(P x, P y)
{
    if(x.a != y.a) return x.a > y.a;
    return x.b < y.b;
}

bool cmp2(P x, P y)
{
    if(x.b != y.b) return x.b > y.b;
    return x.a < y.a;
}

int main()
{
    int n, x, y;
    scanf("%d%d%d", &n, &x, &y);
    for(int i = 1;i <= n; i++)
    {
        int a, b;
        scanf("%d%d", &a, &b);
        p[i].a = a;
        p[i].b = b;
    }
    ll sum1, sum2;
    sum1 = sum2 = 0;
    sort(p + 1, p + 1 + n, cmp1);
    for(int i = 1;i <= n; i++)
    {
        if(i <= x) sum1 += p[i].a;
        else sum1 += p[i].b;
    }
    sort(p + 1, p + 1 + n, cmp2);
    for(int i = 1;i <= n; i++)
    {
        if(i <= y) sum2 += p[i].b;
        else sum2 += p[i].a;
    }
    printf("%lld\n", max(sum1, sum2));
    return 0;
}

