vector<int>vec[maxn];
void solve(int n)
{
	queue<int>q;
	memset(ans,0,sizeof(ans));
	for (int i = 1 ; i <= n ; i ++)
	{
		if (!d[i]) 
		{
			ans[i] = 1;
			q.push(i);
		}
	}
	while(!q.empty())
	{
		int k = q.front();
		q.pop();
		for (int i = 0 ; i < vec[k].size() ; i ++)
		{
			int v = vec[k][i];
			d[v] --;
			ans[v] = (ans[v] + ans[k]) % mod;
			if (!d[v]) q.push(v);
 		}
	}
}
