ll ksm(ll a,ll b)
{
    ll res=1;

    while(b>0)
    {
        if(b&1)
        {
            res*=a;
            res%=mod;
        }
        a*=a;
        a%=mod;
        b>>=1;
    }

    return res;
}

void exgcd(ll a,ll b,ll &x,ll &y)
{
    if(a<b) return exgcd(b,a,y,x);

    if(b==0)
    {
        x=1;y=0;
        return;
    }
    else
    {
        ll x1;
        exgcd(b,a%b,x1,x);
        y=x1-(a/b)*x;
        return;
    }
}

