int insert(int id, string str) {
    int val = str.length();

    int root = 0;

    for (int i = 0, len = str.length(); i < len; ++i) {
        char to = str[i];
        if (s[root].ch[to - 'a'] == 0) {
            s[root].ch[to - 'a'] = ++tot;
            s[tot].maxid = 0;
        }
        root = s[root].ch[to - 'a'];
        int need = 0;
        if (s[root].maxid == 0) {
            need = len;
        } else {
            need = id - s[root].maxid + len - i - 1;
        }
        val = min(val, need);
        s[root].maxid = id;
    }

    return val;
}

