ll cal(ll r)
{
    ll sum = 0;
    if (r == 0) return 0;
    for (int i = 1 ; i <= r ; i ++)
    {
        if ((sum / i) != (sum / (i + 1)))
        {
            sum += n / i;
        }
        else
        {
            ll an = n / i;
            ll fin = n / an;
            if (fin >= r)
            {
                sum += (r - i + 1) * an;
                break;
            }
            else
            {
                sum += (fin - i + 1) * an;
                i = fin;
            }
        }
    }
    return sum;
}


