ll n , l , r;

ll cal(ll l , ll r)
{
    ll sum = 0;
    ll sum_l = 0 , sum_r = 0;
    int flag_l = 0;
    if (l == 0) flag_l = 1;
    for (int i = 1 ; i <= r ; i ++)
    {
        if (i == l + 1)
        {
            sum_l = sum;
            flag_l = 1;
        }
        if (i == r)
        {
            sum_r = sum + n / i;
            break;
        }
        if ((n / i) != (n / (i + 1)))
        {
            sum += n / i;
        }
        else
        {
            ll an = n / i;
            ll fin = n / an;
            if (fin >= r)
            {
                if (!flag_l)
                {
                    sum_l = sum + (l - i + 1) * an;
                }
                sum += (r - i + 1) * an;
                sum_r = sum;
                break;
            }
            else
            {
                if (fin >= l && !flag_l)
                {
                    sum_l = sum + (l - i + 1) * an;
                    flag_l = 1;
                }
                sum += (fin - i + 1) * an;
                i = fin;
            }
        }
    }
    //cout<<"sum_l = "<<sum_l<<endl;
    //cout<<"sum_r = "<<sum_r<<endl;
    return sum_r - sum_l;
}


