ll dp[maxn];
int in[maxn],ou[maxn];
vector <int> v[maxn];
void solve() {
	int n,m;
	scanf("%d%d",&n,&m);
	for(int i=1; i<=m; i++) {
		int x,y;
		scanf("%d%d",&x,&y);
		v[x].push_back(y);
		in[y]++;
		ou[x]++;
	}
	queue <int > q;
	for(int i=1; i<=n; i++) {
		if(!in[i]) {
			q.push(i);
			dp[i]=1;
		}
	}
	ll ans=0;
	while(q.size()) {
		int u=q.front();
		q.pop();
		if(ou[u]==0) ans=(ans+dp[u])%mod;
		for(int i=0; i<v[u].size(); i++) {
			int to =v[u][i];
			in[to]--;
			dp[to]=(dp[to]+dp[u])%mod;
			if(in[to]==0) 	q.push(to);
		}
	}
	printf("%lld",ans);
}
int main() {
	int t=1;
//	scanf("%d",&t);
	while(t--) {
		solve();
	}
