int solve(ll n, ll l, ll r){
    ll res = 0,a=1,flag=1;
    while(a*(a+1) <= n){
        ll num;
        if(n/(a+1) > r) continue;
        if(flag){
            num = r-n/(a+1);
            flag = 0;
        }
        else num = 200/a-200/(a+1);
        res+=num*a;
        a++;
    }
