// 1 <= l <= r <= n <= 1e14
ll solve(ll n, ll l, ll r){
    ll res = 0;
    ll t=n/r;
    ll c1=r+1,c2=n/(t+1)+1;
    while(1){
    	res+=t*(c1-c2);
    	if(c2==l) break;
    	t=n/(c2-1);
    	c1=c2;
    	c2=n/(t+1)+1;
    	if(c2<l) c2=l;
	}

    return res;
}


