#define ll long long

const int base = 131;
const int modone = 1e9 + 7;
const int modtwo = 1e9 + 9;

map<pair<ll, ll> , int> mp;

int main() {
    ios::sync_with_stdio(false);
    int n; cin >> n;
    ll ans = n;
    for (int i = 1; i <= n; ++i) {
        string s;
        cin >> s;
		ll hashvalone = 0, hashvaltwo = 0; int num = s.length();
        for (int j = 0, len = s.length(); j < len; ++j) {
			hashvalone = (hashvalone * base % modone + s[j]) % modone;
			hashvaltwo = (hashvaltwo * base % modtwo + s[j]) % modtwo;
			if (mp.count({hashvalone, hashvaltwo})) {
				num = min(num, i - mp[{hashvalone, hashvaltwo}] + len - j - 1);
			}
			mp[{hashvalone, hashvaltwo}] = i;
		}
        ans = ans + num;
    }

    cout << ans << '\n';
}

