typedef long long ll;
int n,x,y;
struct point{
	int a,b;
}p[1000010],px[1000010],py[1000010];
bool cmp1(point i,point j){
	return i.a>j.a;
}
bool cmp2(point i,point j){
	return i.b>j.b;
}
int main(){
	scanf("%d %d %d",&n,&x,&y);
	int cntx=0,cnty=0;
	for(int i=1;i<=n;i++){
		scanf("%d %d",&p[i].a,&p[i].b);
		if(p[i].a>p[i].b) px[++cntx]=p[i];
		else py[++cnty]=p[i];
//	cout<<cntx<<" "<<cnty<<endl;	
	}

	ll ans=0;
	sort(px+1,px+1+cntx,cmp1);
	sort(py+1,py+1+cnty,cmp2);
	if(cntx<x){
		for(int i=1;i<=cntx;i++)ans+=px[i].a;
		for(int i=1;i<=y;i++)ans+=py[i].b;
		for(int i=y+1;i<=cnty;i++)ans+=py[i].a;
	}
	else{
		for(int i=1;i<=cnty;i++)ans+=py[i].b;
		for(int i=1;i<=x;i++)ans+=px[i].a;
		for(int i=x+1;i<=cntx;i++)ans+=px[i].b;
	}
	printf("%lld",ans);
