#include<bits/stdc++.h>
#define LL long long
#define MAXN 100005
#define MAXM 1000005
#define Mod 1000000007
using namespace std;
struct Point{int Rd,Cd,Next,Tag;LL Kind;}P[MAXN];
struct Edge{int To,Next;}E[MAXM];
int N,M,Len;
queue<int>Q;
void Make(int a,int b){
	E[++Len].To=b;
	E[Len].Next=P[a].Next;
	P[a].Next=Len;
	P[a].Cd++;
	P[b].Rd++;
}
int main(){
	int a,b,c,i,j,n,x,y,z;
	int Now,To;
	LL Ans=0;
	scanf("%d%d",&N,&M);
	for(i=1;i<=M;i++){
		scanf("%d%d",&a,&b);
		Make(a,b);
	}
	for(i=1;i<=N;i++){
		if(P[i].Rd==0){
			P[i].Kind=1;
			Q.push(i);
		}
		if(P[i].Cd==0)
			P[i].Tag=1;
	}
	while(!Q.empty()){
		Now=Q.front();
		Q.pop();
		for(i=P[Now].Next;i;i=E[i].Next){
			To=E[i].To;
			P[To].Kind+=P[Now].Kind;
			P[To].Rd--;
			if(P[To].Rd==0)
				Q.push(To);
		}
	}
	for(i=1;i<=N;i++)
		if(P[i].Tag==1)
			Ans=(Ans+P[i].Kind)%Mod;
	printf("%lld",Ans);
}

