typedef long long ll;
const int MAXN = 1e9+1;
const int N = 1e5+1;

int solve(ll n, ll l, ll r){
    ll res = 0,a=1,flag=1;
    while(a*(a+1) <= n){
        ll num;
        if(n/(a+1) > r) continue;
        if(flag){
            num = r-n/(a+1);
            if(200 / (a+1) < l) {
                    num = r - l+1;
                    res += num*a;
                    break;
            }
            flag = 0;
        }
        else {
            num = 200/a-200/(a+1);
            if(200 / (a+1) < l) {
                    num = 200/a - l+1;
                    res += num*a;
                    break;
            }
        }
        res+=num*a;
        a++;
    }
    while(a>=l){
        res += n/a;
        a--;
    }
    return res;
}

int main(){
    ll l,r,n;
    ll ans;
    cin>>n>>l>>r;
    ans = solve(n,l,r);
    cout<<ans<<endl;
    return 0;
}

