using namespace std;
struct Point{int Rd,Cd,Next,Tag;LL Kind;}P[MAXN];
struct Edge{int To,Next;}E[MAXM];
int N,M,Len;
queue<int>Q;
void Make(int a,int b){
	E[++Len].To=b;
	E[Len].Next=P[a].Next;
	P[a].Next=Len;
	P[a].Cd++;
	P[b].Rd++;
}
int main(){
	int a,b,c,i,j,n,x,y,z;
