	}
	for(i=1;i<=N;i++){
		if(P[i].Rd==0){
			P[i].Kind=1;
			Q.push(i);
		}
		if(P[i].Cd==0)
			P[i].Tag=1;
	}
	while(!Q.empty()){
		Now=Q.front();
		Q.pop();
		for(i=P[Now].Next;i;i=E[i].Next){
			To=E[i].To;
			P[To].Kind=(P[To].Kind+P[Now].Kind)%Mod;
			P[To].Rd--;
			if(P[To].Rd==0)
				Q.push(To);
		}
	}
