int h[N], e[N], ne[N], idx, ct[N], me[N];

void add(int a, int b){
    ct[b]++, e[idx] = b, ne[idx] = h[a], h[a] = idx ++;
}

ll cnt;
int n,m;

int f(int p){
    if(h[p] == -1)return 1;
    if(me[p])return me[p];
    else{
        for(int i = h[p]; i != -1; i = ne[i]){
            int j = e[i];
            me[p] = me[p] % M + f(j) % M;
        }
    }
    return me[p];
}

void func(){

    for(int i = 1; i <= n; ++i){
        if(!ct[i]){
            for(int j = h[i]; j != -1; j = ne[j]){
                int k = e[j];
                cnt = cnt % M+ f(k) % M ;
            }
        }
    }

}

