void add(int a , int b)
{
    v[a].push_back(b);
    chu[a] ++;
    ru[b] ++;
}

struct Node
{
    int id;
    int val;
    int ru;
    bool operator < (const Node &a) const
    {
        return ru > a.ru;
    }
};

void bfs()
{
    priority_queue<Node>q;
    for (auto it : st)
    {
        Node temp;
        temp.id = it;
        temp.val = 1;
        di[it] = 1;
        temp.ru = 0;
        q.push(temp);
    }
    while(!q.empty())
    {
        Node Q = q.top();
        q.pop();
        int k = Q.id;
        if (vis[k]) continue;
        vis[k] = 1;
        for (auto it : v[k])
        {
            //cout<<"k = "<<k<<' '<<"it = "<<it<<' '<<"di[it] = "<<di[it]<<' '<<"di[k] = "<<di[k]<<endl;
            Node nex;
            nex.id = it;
            ru[it] --;
            nex.ru = ru[it];
            nex.val = (di[it] + di[k]) % mod;
            di[it] = nex.val;
            q.push(nex);
        }
    }
}

