void add(int a, int b)
{
    e[idx] = b;
    ne[idx] = h[a];
    h[a] = idx++;
}

int solve()
{
    queue<int> q;
    for(int i = 1;i <= n; i++)
    {
        if(d[i] == 0)
        {
            q.push(i);
            res[i] = 1;
        }
    }
    while(q.size())
    {
        int t = q.front();
        q.pop();

        for(int i = h[t];i != -1; i = ne[i])
        {
            int j = e[i];
//            printf("%d %d\n", t, j);
            d[j]--;
            res[j] = (res[j] + res[t]) % mod;
            if(d[j] == 0) q.push(j);
        }
    }
    int ans = 0;
    for(int i = 1;i <= n; i++)
    {
//        printf("res[%d] = %d\n", i, res[i]);
        if(h[i] == -1) ans = (ans + res[i]) % mod;
    }
    return ans;
}

