    ll res = 0;
    for(ll i = l; i <= r; i++)  res = res + n / i;
    return res;
}

int solve(ll n, ll l, ll r){
    ll res = 0,a=1,flag=1;
    while(a*(a+1) <= n){
        ll num;
        if(n/(a+1) > r) {a++;continue;}
        if(flag){
            num = r-n/(a+1);
            if(n / (a+1) < l) {
                    num = r - l+1;
                    res += num*a;
                    break;
            }
            flag = 0;
        }
        else {
            num = n/a-n/(a+1);
            if(n / (a+1) < l) {
                    num = n/a - l+1;
                    res += num*a;
                    break;
            }
        }
        res+=num*a;
        a++;
    }
    while(a>=l){
        res += n/a;
        a--;
    }
    return res;
}

