int gcd(int i, int n)
{
	int t;
	if (i == 0 || n == 0)return 0;
	if (i < n)
	{
		t = i;
		i = n;
		n = t;
	}
	while (n != 0)
	{
		t = i % n;
		i = n;
		n = t;
	}
	return i;
}
