inline void add(int u,int v,ll w)
{
	edge[cnt].to = v;
	edge[cnt].val = w;
	edge[cnt].next = head[u];
	head[u] = cnt ++;

    edge[cnt].to = u;
	edge[cnt].val = 0;
	edge[cnt].next = head[v];
	head[v] = cnt ++;
}

inline int bfs(int s,int t,int n)
{ 
	for(register int i = 0 ; i <= n ; i++)
        dis[i] = inf;
	queue<int> q;
	q.push(s);
	dis[s] = 0;
	now[s] = head[s];
	while(!q.empty())
	{
		int x = q.front();
		q.pop();
		for(register int i = head[x] ; i != -1 ;i = edge[i].next)
		{
			int v = edge[i].to;
			if(edge[i].val > 0 && dis[v] == inf)
			{
				q.push(v);
				now[v] = head[v];
				dis[v] = dis[x] + 1;
				if(v == t) return 1;
			}
		}
	}
	return 0;
}

inline int dfs(int x,int t,ll sum)
{  
	if(x == t) return sum;
	ll k,res = 0;  
	for(register int i = now[x] ; i != -1 && sum; i = edge[i].next)
    {
		now[x] = i;  
		int v = edge[i].to;
		if(edge[i].val > 0 && (dis[v] == dis[x] + 1))
		{
			k = dfs(v,t,min(sum,edge[i].val));
			if(k == 0) dis[v] = inf; 
			edge[i].val -= k;
			edge[i ^ 1].val += k;
			res += k;  
			sum -= k;  
		}
	}
	return res;
}
