        {
            Point t;
            t.x = q.x - 1 , t.y = q.y;
            if ((s.p1.y == q.y && s.p1.x <= q.x) || (s.p2.y == q.y && s.p2.x <= q.x))
            {
                int tt;
                if (s.p1.y == q.y)
                    tt = 1;
                else if (s.p2.y == q.y)
                    tt = 2;
                int maxx;
                if(s.p1.y > s.p2.y)
                    maxx = 1;
                else
                    maxx = 2;
                if (tt == maxx)
                    c ++;
            }
            else
            {
                if (xmulti(s.p1 , t , q) * xmulti(s.p2 , t , q) <= 0)
                {
                    Point lowp , higp;
                    if (s.p1.y > s.p2.y)
                    {
                        lowp.x = s.p2.x , lowp.y = s.p2.y;
                        higp.x = s.p1.x , higp.y = s.p1.y;
                    }
                    else
                    {
                        lowp.x = s.p1.x , lowp.y = s.p1.y;
                        higp.x = s.p2.x , higp.y = s.p2.y;
                    }
                    if (xmulti(q , higp , lowp) >= 0)
                    {
                        c ++;
                    }
                }
            }
        }
    }
    if (c % 2 == 0)
    {
        return false;
    }
    else return true;
}

int nn[5];

bool Point_in_polygon(Point pt , Point *p , int n)
{
    for (int i = 0 ; i < n ; i ++)
    {
        if (p[i] == pt) return 1;
    }
    for (int i = 0 ; i < n ; i ++)
    {
        Line v = Line(p[i] , p[(i + 1) % n]);
        if (Point_on_seg(pt , v)) return 1;
    }
    int num = 0;
    for (int i = 0 ; i < n ; i ++)
    {
        int j = (i + 1) % n;
        int c = sgn(Cross(pt - p[j] , p[i] - p[j]));
        int u = sgn(p[i].y - pt.y);
        int v = sgn(p[j].y - pt.y);
        if (c > 0 && u < 0 && v >= 0) num ++;
        if (c < 0 && u >= 0 && v < 0) num --;
    }
    return num != 0;
}

double cal_inter_area()
{
    int t;
    t = 3;
    int lenow;
    for (int i = 1 ; i <= t ; i ++)
    {
        int n;
        n = nn[i];
        for (int j = 0 ; j < n ; j ++)
        {
            nex[j] = sq[i][j + 1];
        }
        if (i == 1)
        {
            for (int j = 0 ; j < n ; j ++)
            {
                now[j] = nex[j];
            }
            lenow = n;
        }
        else
        {
            int cnt = 0;
            for (int j = 0 ; j < lenow ; j ++)
            {
                for (int w = 0 ; w < n ; w ++)
                {
                    if (cross_segment(now[j] , now[(j + 1) % lenow] , nex[w] , nex[(w + 1) % n]))
                    {
                        over[cnt ++] = Cross_Point(now[j] , now[(j + 1) % lenow] , nex[w] , nex[(w + 1) % n]);
                    }
                }
            }
            int tot = 0;
            for (int j = 0 ; j < lenow ; j ++)
            {
                if (Point_in_polygon(now[j] , nex , n) && Point_in_polygon(now[j] , now , lenow))
                {
                    res[tot ++] = now[j];
                }
            }
            for (int j = 0 ; j < n ; j ++)
            {
                if (Point_in_polygon(nex[j] , nex , n) && Point_in_polygon(nex[j] , now , lenow))
                {
                    res[tot ++] = nex[j];
                }
            }
            for (int j = 0 ; j < cnt ; j ++)
            {
                if (Point_in_polygon(over[j] , nex , n) && Point_in_polygon(over[j] , now , lenow))
                {
                    res[tot ++] = over[j];
                }
            }
            if (tot <= 2)
            {
                return 0;
            }
            else
            {
                sort(res + 1 , res + tot , cmp);
                for (int j = 0 ; j < tot ; j ++)
                {
                    now[j] = res[j];
                }
                lenow = tot;
            }
        }
    }
    double ans = 0;
    for (int i = 0 ; i < lenow ; i ++)
    {
        ans += Cross(now[i] , now[(i + 1) % lenow]);
    }
    return 0.5 * ans;
}


