long long cul(long long a)
{
    long long b=0;
    for(long long l=1,r=0;l<=a;l=r+1)
    {
        r=a/(a/l);
        long long n=a/l;
        if(n<4) break;
        b+=((sqrt(n)-1)*(r-l+1));
    }
    return b;
}

