		{
			int flag = 0;
			if (!j) 
			{
				add(i,m + j + 1,inf);
				continue;
			}
			for (int k = 0 ; k <= 3 ; k ++)
			{
				if (((j >> k) & 1) > a[k + 1]) flag = 1;
