	if(i.a!=j.a)return i.a>j.a;
	else return i.b<j.b;
}
bool cmp2(point i,point j){
	if(i.b!=j.b)return i.b>j.b;
	else return i.a<j.a;
}
int main(){
	scanf("%d %d %d",&n,&x,&y);
