#define ll long long

ll m;

// ll all = 0;
bool check(ll val) {
    // cout << val << '\n';
    ll ans = 0;
    // int cnt = 0;
    for (ll li = 1, ri = 0; li <= val; li = ri + 1) {
        // ++cnt;
        ll num = val / li;
        ll limit = (ll) sqrt(num);
        if (1ll * (limit - 1) * (limit - 1) == 0) ri = val;
        else ri = max((val / (1ll * (limit) * (limit))), val / num);
        ri = min(ri, val);
        // cout << li << ' ' << ri << ' ' << limit << '\n';
        ans = ans + 1ll * (ri - li + 1) * ((ll)sqrt(num) - 1);
    }
    // cout << cnt << '\n'; all += cnt;
    return ans >= m;
}

int main() {
    scanf("%lld", &m);

    ll l = 1, r = 1e13, ans;

    while (l <= r) {
        // cout << l << ' ' << r << '\n';
        ll mid = (l + r) / 2;
        if (check(mid)) {
            ans = mid;
            r = mid - 1;
        } else l = mid + 1;
    }

    // cout << all << '\n';
    cout << ans << '\n';
}

