		unsigned long long n;
	} a[2769433];
	int &operator [](const unsigned long long &x)
	{
		unsigned long long t = x % hash_size;
		while(a[t].n != 0 && a[t].n != x)
		{
			t++;
			if (t == hash_size) t = 0;
		}
		a[t].n = x;
		return a[t].x;
	}
	bool count(unsigned long long x)
	{
		unsigned long long t = x % hash_size;
		while(a[t].n != 0 && a[t].n != x)
		{
			t++;
			if (t == hash_size) t = 0;
		}
		if (a[t].n == x) return 1;
		else return 0;
	}
} map;

