// 1 <= l <= r <= n <= 1e14
ll solve(ll n, ll l, ll r){
    ll res = 0;
    ll k = n / r;
    for(ll i = k;l < r && i <= r; i++)
    {
        ll t = n / i;
        if(t >= l && t <= r)
        {
            res += (i - 1) * (r - t + 1);
            if(t * i <= n) res -= i - 1;
            else t --;
            r = t;
        }
    }
    res += n / l;
    return res;
}


