const int maxn = 5e3 + 50;

int a[maxn];
char s[maxn];
ll mod = 1e9 + 7;
ll C[maxn][maxn];

ll qpow(ll x ,ll n , ll mod)
{
    ll res = 1;
    while(n)
    {
        if (n & 1) res = res * x % mod;
        x = x * x % mod;
        n >>= 1;
    }
    return res;
}

ll inv(ll q)
{
    return (q , mod - 2 , mod);
}

ll sum = 0;

void init(int n)
{
    C[0][n] = 1;
    C[n][n] = 1;
    for (int i = 1 ; i <= n - 1 ; i ++)
    {
        C[i][n] = C[i - 1][n] * (n - i + 1) % mod;
        C[i][n] = C[i][n] * inv(i) % mod;
    }
}

int ling_cnt = 0;
int n;

ll cal(int ling)
{
    ll res = sum;
    res += ling_cnt - ling;
    //cout<<sum<<endl;
    return qpow(2 , res , mod);
}

