typedef long long ll;

// 1 <= l <= r <= n <= 1e14
ll solve(ll n, ll l, ll r){
    ll res = 0;
    ll i;
    for(i = l;i <= n / i; i++) res += n / i;
    l = i;
    ll k = n / r;
    for(ll i = k;l < r; i++)
    {
        ll t = n / i;
        if(t >= l && t <= r)
        {
            res += (i - 1) * (r - t + 1);
            if(t * i <= n) res -= i - 1;
            else t --;
            r = t;
        }
    }
    res += n / l;
    return res;
}


int main()
{
    ll n, l, r;
    scanf("%lld%lld%lld", &n, &l, &r);
    printf("%lld\n", solve(n, l, r));
    return 0;
}

