#include <bits/stdc++.h>
#define ll long long
using namespace std;
const int maxn = 5e3 + 50;

int a[maxn];
char s[maxn];
ll mod = 1e9 + 7;
ll C[maxn][maxn];

ll qpow(ll x ,ll n , ll mod)
{
    ll res = 1;
    while(n)
    {
        if (n & 1) res = res * x % mod;
        x = x * x % mod;
        n >>= 1;
    }
    return res;
}

ll inv(ll q)
{
    return (q , mod - 2 , mod);
}

ll sum = 0;

void init(int n)
{
    C[0][n] = 1;
    C[n][n] = 1;
    for (int i = 1 ; i <= n - 1 ; i ++)
    {
        C[i][n] = C[i - 1][n] * (n - i + 1) % mod;
        if (i == 1) continue;
        C[i][n] = C[i][n] * inv(i) % mod;
    }
    //cout<<C[1][2]<<endl;
}

int ling_cnt = 0;
int n;

ll cal(int ling)
{
    ll res = sum;
    res += ling_cnt - ling;
    //cout<<res<<' '<<C[ling][ling_cnt]<<endl;
    return qpow(2 , res , mod);
}

int main()
{
    ios::sync_with_stdio(false);
    cin>>s;
    n = strlen(s);
    int cnt = 0;
    int now = 0;
    int flag = 0;
    for (int i = 0 ; i < n ; i ++)
    {
        if(s[i] == '0' && flag == 1)
        {
            a[++ cnt] = now - 1;
            now = 0;
            ling_cnt ++;
            flag = 0;
        }
        else if (s[i] != '0')
        {
            flag = 1;
            now ++;
        }
    }
    if (now != 0) a[++ cnt] = now - 1;
    if (s[n - 1] == '0')
    {
        ling_cnt --;
    }
    //cout<<"ling_cnt = "<<ling_cnt<<endl;
    init(ling_cnt);
    sum = 0;
    for (int i = 1 ; i <= cnt ; i ++)
    {
        sum += a[i];
    }
    //cout<<sum<<endl;
    ll ans = 0;
    for (int i = 0 ; i <= ling_cnt ; i ++)
    {
        ans += ((cal(i) % mod) * C[i][ling_cnt])% mod;
        //cout<<((cal(i) % mod) * C[i][ling_cnt])% mod<<endl;
    }
    if (ans == 0) ans = 1;
    int f = 0 , li_cnt = 1;
    for (int i = n - 1 ; i >= 0 ; i --)
    {
        if (s[i] == '0')
        {
            li_cnt ++;
        }
        else
        {
            f = 1;
            break;
        }
    }
    if (f) ans = ans * li_cnt % mod;
    cout<<ans<<endl;
}

