    {
        ll a = s.front();
        s.pop();
        for (ll i = head[a]; i; i = e[i].next)
        {
            ll y = e[i].to;
            dis[y] += dis[a];
            vis[y]--;
            if (vis[y] == 0)
                s.push(y);
        }
