#include<bits/stdc++.h>
#define ll long long
using namespace std;
const int mod=1e9+7,N=1e5+10,M=1e6+10;
int h[N],e[M],ne[M],idx;
int n,m;
ll ans,g[N];
int in[N],out[N];
bool st[N];


void add(int u,int v)
{
	e[idx]=v;
	ne[idx]=h[u];
	h[u]=idx++;
}

ll dfs(int x)
{
	if(g[x]!=-1) return g[x];
	ll res=0;
	st[x]=true;
	if(out[x]==0){
		st[x]=false;
		g[x]=1;
		return g[x];
	}
	for(int i=h[x];i!=-1;i=ne[i]){
		int j=e[i];
		if(!st[j]) 
		{
			res=(res+dfs(j))%mod;
		}
	}
	st[x]=false;
	g[x]=res%mod;
	return g[x];
}

int main()
{
	cin>>n>>m;
	memset(h,-1,sizeof h);
	memset(g,-1,sizeof g);
	for(int i=0;i<m;i++){
		int u,v;
		cin>>u>>v;
		add(u,v);
		in[v]++;
		out[u]++;
	}
