ll qpow(ll x ,ll n , ll mod)
{
    ll res = 1;
    while(n)
    {
        if (n & 1) res = res * x % mod;
        x = x * x % mod;
        n >>= 1;
    }
    return res;
}

ll inv(ll q)
{
    return qpow(q , mod - 2 , mod);
}

ll sum = 0;

void init(int n)
{
