    C[n][n] = 1;
	//cout<<"n = "<<n<<endl;
    for (int i = 1 ; i <= n - 1 ; i ++)
    {
        C[i][n] = C[i - 1][n] * (n - i + 1) % mod;
        if (i == 1) 
		{
			//cout<<"i = "<<i<<' '<<C[i][n]<<endl;
			continue;
		}
        C[i][n] = C[i][n] * inv(i) % mod;
