typedef Point Vector;

double dot(Point a , Point b)
{
    return a.x * b.x + a.y * b.y;
}

double Cross(Point a , Point b)
{
    return a.x * b.y - a.y * b.x;
}

bool cmp(Point r , Point t)
{
    Point tt = t - res[0];
    Point rr = r - res[0];
    if (sgn(Cross(rr , tt)) == 0)
    {
        return (rr.x * rr.x + rr.y * rr.y) < (tt.x * tt.x + tt.y * tt.y);
    }
    return sgn(Cross(rr , tt)) > 0;
}

struct Line
{
    Point p1 , p2;
    Line(){};
    Line(Point p1 , Point p2):p1(p1),p2(p2){}
};

typedef Line segment;

bool Point_on_seg(Point p , Line v)
{
    return sgn(Cross(p - v.p1 , v.p2 - v.p1)) == 0 && sgn(dot(p - v.p1 , p - v.p2)) <= 0;
}

Point Cross_Point(Point a , Point b , Point c ,Point d)
{
    double s1 = Cross(b - a , c - a);
    double s2 = Cross(b - a , d - a);
    return Point(c.x * s2 - d.x * s1 , c.y * s2 - d.y * s1) / (s2 - s1);
}

double xmulti(Point p1 , Point p2 , Point p0)
{
    return (p1.x - p0.x) * (p2.y - p0.y) - (p2.x - p0.x) * (p1.y - p0.y);
}

bool cross_segment(Point a , Point b , Point c ,Point d)
{
    double c1 = Cross(b - a , c - a) , c2 = Cross(b - a , d - a);
    double d1 = Cross(d - c , a - c) , d2 = Cross(d - c , b - c);
    return sgn(c1) * sgn(c2) < 0 && sgn(d1) * sgn(d2) < 0;
}
double Max(double a , double b)
{
    return a > b ? a : b;
}

double Min (double a , double b)
{
    return a < b ? a : b;
}

bool ponls(Point q , Line l)
{
    if (q.x > Max(l.p1.x , l.p2.x) || q.x < Min(l.p1.x , l.p2.x)
        || q.y > Max(l.p1.y , l.p2.y) || q.y < Min(l.p1.y , l.p2.y))
    {
        return false;
    }
    if (xmulti(l.p1 , l.p2 , q) == 0)
    {
        return true;
    }
    else return false;
}

bool judge(int pointnum , Point p[] , Point q)
{
    Line s;
    int c = 0;
    for (int i = 1 ; i <= pointnum ; i ++)
    {
        if (i == pointnum)
        {
            s.p1 = p[pointnum] , s.p2 = p[1];
        }
        else
        {
            s.p1 = p[i] , s.p2 = p[i + 1];
        }
        if (ponls(q,s))
        {
            return true;
        }
        if (s.p1.y != s.p2.y)
        {
            Point t;
            t.x = q.x - 1 , t.y = q.y;
            if ((s.p1.y == q.y && s.p1.x <= q.x) || (s.p2.y == q.y && s.p2.x <= q.x))
            {
                int tt;
                if (sgn(s.p1.y - q.y) == 0)
                    tt = 1;
                else if (sgn(s.p2.y - q.y) == 0)
                    tt = 2;
                int maxx;
                if(s.p1.y > s.p2.y)
                    maxx = 1;
                else
                    maxx = 2;
                if (tt == maxx)
                    c ++;
            }
            else if (xmulti(s.p1 , t , q) * xmulti(s.p2 , t , q) <= 0)
            {
                Point lowp , higp;
                if (s.p1.y > s.p2.y)
                {
                    lowp.x = s.p2.x , lowp.y = s.p2.y;
                    higp.x = s.p1.x , higp.y = s.p1.y;
                }
                else
                {
                    lowp.x = s.p1.x , lowp.y = s.p1.y;
                    higp.x = s.p2.x , higp.y = s.p2.y;
                }
                if (xmulti(q , higp , lowp) >= 0)
                    c ++;
            }
        }
    }
    if (c % 2 == 0)
    {
        return false;
    }
    else return true;
}

int nn[5];

bool Point_in_polygon(Point pt , Point *p , int n)
{
    for (int i = 0 ; i < n ; i ++)
    {
        if (p[i] == pt) return 1;
    }
    for (int i = 0 ; i < n ; i ++)
    {
        Line v = Line(p[i] , p[(i + 1) % n]);
        if (Point_on_seg(pt , v)) return 1;
    }
    int num = 0;
    for (int i = 0 ; i < n ; i ++)
    {
        int j = (i + 1) % n;
        int c = sgn(Cross(pt - p[j] , p[i] - p[j]));
        int u = sgn(p[i].y - pt.y);
        int v = sgn(p[j].y - pt.y);
        if (c > 0 && u < 0 && v >= 0) num ++;
        if (c < 0 && u >= 0 && v < 0) num --;
    }
    return num != 0;
}

double cal_inter_area()
{
    int t;
    t = 3;
    int lenow;
    for (int i = 1 ; i <= t ; i ++)
    {
        int n;
        n = nn[i];
        for (int j = 0 ; j < n ; j ++)
        {
            nex[j] = sq[i][j + 1];
        }
        res[0] = nex[0];
        sort(nex , nex + n , cmp);
        if (i == 1)
        {
            for (int j = 0 ; j < n ; j ++)
            {
                now[j] = nex[j];
            }
            lenow = n;
        }
        else
        {
            int cnt = 0;
            for (int j = 0 ; j < lenow ; j ++)
            {
                for (int w = 0 ; w < n ; w ++)
                {
                    if (cross_segment(now[j] , now[(j + 1) % lenow] , nex[w] , nex[(w + 1) % n]))
                    {
                        over[cnt ++] = Cross_Point(now[j] , now[(j + 1) % lenow] , nex[w] , nex[(w + 1) % n]);
                    }
                }
            }
            int tot = 0;
            for (int i = 1 ; i <= n ; i ++)
            {
                temp_nex[i] = nex[i - 1];
            }
            for (int i = 1 ; i <= lenow ; i ++)
            {
                temp_now[i] = now[i - 1];
            }
            for (int j = 0 ; j < lenow ; j ++)
            {
                if (judge(n , temp_nex , now[j]) && judge(lenow , temp_now , now[j]))
                {
                    res[tot ++] = now[j];
                }
            }
            for (int j = 0 ; j < n ; j ++)
            {
                if (judge(n , temp_nex , nex[j]) && judge(lenow , temp_now , nex[j]))
                {
                    res[tot ++] = nex[j];
                }
            }
            for (int j = 0 ; j < cnt ; j ++)
            {
                if (judge(n , temp_nex , over[j]) && judge(lenow , temp_now , over[j]))
                {
                    res[tot ++] = over[j];
                }
            }
            if (tot <= 2)
            {
                return 0.0;
            }
            else
            {
                sort(res + 1 , res + tot , cmp);
                for (int j = 0 ; j < tot ; j ++)
                {
                    now[j] = res[j];
                }
                lenow = tot;
            }
        }
    }
    double ans = 0;
    for (int i = 0 ; i < lenow ; i ++)
    {
        ans += Cross(now[i] , now[(i + 1) % lenow]);
    }
    if (sgn(ans) < 0) assert(0);
    return 0.5 * ans;
}


