ll qpow(ll x ,ll n , ll mod)
{
    ll res = 1;
    while(n)
    {
        if (n & 1) res = res * x % mod;
        x = x * x % mod;
        n >>= 1;
    }
    return res;
}

ll inv(ll q)
{
    return qpow(q , mod - 2 , mod);
}

ll sum = 0;

void init(int n)
{
    C[0][n] = 1;
    C[n][n] = 1;
	//cout<<"n = "<<n<<endl;
    for (int i = 1 ; i <= n - 1 ; i ++)
    {
        C[i][n] = C[i - 1][n] * (n - i + 1) % mod;
        if (i == 1)
		{
			//cout<<"i = "<<i<<' '<<C[i][n]<<endl;
			continue;
		}
        C[i][n] = C[i][n] * inv(i) % mod;
		/*cout<<"i = "<<i<<' '<<inv(i)<<endl;
		cout<<"i = "<<i<<' '<<C[i][n]<<endl;*/
    }
}

